import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';


import logo from "../React/titlelog.png";
import "./SignUp.scss";


const useStyles = makeStyles((theme) => ({
  // root: {
  //   '& > *': {
  //     margin: theme.spacing(1),
  //     width: '35ch',
  //   },
  // },
  input1:{

  }



}));





const SignUp = () => {
  const classes = useStyles();
  return (
    <>
      <div className="main_container">
        <div className="centrel_div">
          <div className="img">
            <img className="logo_img" src={logo} alt="Error" />
          </div>
          <div className="heading">
            <h3 className="heading_title">
              Entre Your Details
            </h3>
          </div>
          <div className="inputs">
          <TextField id="filled-basic" label="First Name" variant="outlined"
          style={{ width: "100%", height:'60px', marginBottom: "25pxpx" }} />
          <TextField id="filled-basic" label="Last Name" variant="outlined" />
          <TextField id="filled-basic" label="Email Adress" variant="outlined" />
          <TextField id="filled-basic" label="Password" variant="outlined" />
          <TextField id="filled-basic" label="Confirm Password" variant="outlined" />
          <div className="button">
            <button className="submit">CONTINUE</button>
          </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignUp;
